effect_downstreameffect9.getDescriptionIDs().set(new DescriptionSection(effect_downstreameffect9,dataSource,"Description","<div class='description'><h3>Description</h3><p><p><strong>Biological state</strong></p>\n\n<p>Testosterone (T) is a steroid hormone from the androgen group. T serves as a substrate for two metabolic pathways that produce antagonistic sex steroids.</p>\n\n<p><strong>Biological compartments</strong></p>\n\n<p>Testosterone is synthesized by the gonads and other steroidogenic tissues (e.g., brain, adipose), acts locally and/or is transported to other tissues via blood circulation. Leydig cells are the testosterone-producing cells of the testis.</p>\n\n<p><strong>General role in biology</strong></p>\n\n<p>Androgens, the main male sex steroids, are the critical factors responsible for the development of the male phenotype during embryogenesis and for the achievement of sexual maturation at puberty. In adulthood, androgens remain essential for the maintenance of male reproductive function and behaviour. Apart from their effects on reproduction, androgens affect a wide variety of non-reproductive tissues such as skin, bone, muscle, and brain (Heemers, Verhoeven, &amp; Swinnen, 2006). Androgens, principally T and 5&alpha;-dihydrotestosterone (DHT), exert most of their effects by interacting with a specific receptor, the androgen receptor (AR), for review see (Murashima, Kishigami, Thomson, &amp; Yamada, 2015). On the one hand, testosterone can be reduced by 5&alpha;-reductase to produce 5&alpha; dihydrotestosterone (DHT). On the other hand, testosterone can be aromatized to generate estrogens. Testosterone effects can also be classified by the age of usual occurrence, postnatal effects in both males and females are mostly dependent on the levels and duration of circulating free testosterone.</p>\n\n</p></div><div class='references'><h3>References</h3><p><p>Heemers, H. V, Verhoeven, G., &amp; Swinnen, J. V. (2006). Androgen activation of the sterol regulatory element-binding protein pathway: Current insights. Molecular Endocrinology (Baltimore, Md.), 20(10), 2265&ndash;77. doi:10.1210/me.2005-0479</p>\n\n<p>Murashima, A., Kishigami, S., Thomson, A., &amp; Yamada, G. (2015). Androgens and mammalian male reproductive tract development. Biochimica et Biophysica Acta, 1849(2), 163&ndash;170. doi:10.1016/j.bbagrm.2014.05.020</p>\n\n<p>Paduch, D. A., Brannigan, R. E., Fuchs, E. F., Kim, E. D., Marmar, J. L., &amp; Sandlow, J. I. (2014). The laboratory diagnosis of testosterone deficiency. Urology, 83(5), 980&ndash;8. doi:10.1016/j.urology.2013.12.024</p>\n\n<p>Taieb, J., Mathian, B., Millot, F., Patricot, M.-C., Mathieu, E., Queyrel, N., &hellip; Boudou, P. (2003). Testosterone measured by 10 immunoassays and by isotope-dilution gas chromatography-mass spectrometry in sera from 116 men, women, and children. Clinical Chemistry, 49(8), 1381&ndash;95.</p>\n\n</p></div>").setFormat(ContentFormat.HTML).<DescriptionSection> makeItLive(), 0);
